            template: "<h2>Container 布局容器</h2>\n<p>用于布局的容器组件，方便快速搭建页面的基本结构：</p>\n<p><code>&lt;el-container&gt;</code>：外层容器。当子元素中包含 <code>&lt;el-header&gt;</code> 或 <code>&lt;el-footer&gt;</code> 时，全部子元素会垂直上下排列，否则会水平左右排列。</p>\n<p><code>&lt;el-header&gt;</code>：顶栏容器。</p>\n<p><code>&lt;el-aside&gt;</code>：侧边栏容器。</p>\n<p><code>&lt;el-main&gt;</code>：主要区域容器。</p>\n<p><code>&lt;el-footer&gt;</code>：底栏容器。</p>\n<div class=\"tip\">\n<p>以上组件采用了 flex 布局，使用前请确定目标浏览器是否兼容。此外，<code>&lt;el-container&gt;</code> 的子元素只能是后四者，后四者的父元素也只能是 <code>&lt;el-container&gt;</code>。</p>\n</div>\n<h3>常见页面布局</h3>\n<div class=\"demo\">\n<pre></pre><Demo0 />\n</div>\n<h3>实例</h3>\n<div class=\"demo\">\n<pre></pre><Demo1 />\n</div>\n<h3>Container Attributes</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>可选值</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>direction</td>\n<td>子元素的排列方向</td>\n<td>string</td>\n<td>horizontal / vertical</td>\n<td>子元素中有 <code>el-header</code> 或 <code>el-footer</code> 时为 vertical，否则为 horizontal</td>\n</tr>\n</tbody>\n</table>\n<h3>Header Attributes</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>可选值</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>height</td>\n<td>顶栏高度</td>\n<td>string</td>\n<td>—</td>\n<td>60px</td>\n</tr>\n</tbody>\n</table>\n<h3>Aside Attributes</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>可选值</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>width</td>\n<td>侧边栏宽度</td>\n<td>string</td>\n<td>—</td>\n<td>300px</td>\n</tr>\n</tbody>\n</table>\n<h3>Footer Attributes</h3>\n<table>\n<thead>\n<tr>\n<th>参数</th>\n<th>说明</th>\n<th>类型</th>\n<th>可选值</th>\n<th>默认值</th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<td>height</td>\n<td>底栏高度</td>\n<td>string</td>\n<td>—</td>\n<td>60px</td>\n</tr>\n</tbody>\n</table>\n"
